import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import { useEffect } from "react";
import { useState } from "react";
import Convert from "convert-svg-react";
//import { SvgXml } from "react-native-svg";

function TrustedLeadingBrandsAPI() {
  const [data, setData] = useState([]);

  const apiGet = () => {
    fetch("http://127.0.0.1:5000/api_get_trusted_leading_brands")
      .then((respose) => respose.json())
      .then((json) => {
        console.log(json);
        setData(json);
      });
  };

  useEffect(() => {
    apiGet();
  }, []);

  const ConvertSVG = (json) => {
    data.map(json);
    Convert(json.brand_image_tb01);
  };

  return (
    <div>
      <div>
        MY API
        <br />
      </div>
      <div>
        {data.map((item) => (
          <div>
            <ConvertSVG />
          </div>
        ))}
      </div>
      <div></div>
    </div>
  );
}

export default TrustedLeadingBrandsAPI;

